contracts/1_ContestadorAutomatico.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

contract ContestadorAutomatico {

    string mensaje;
    uint fecha; // Fecha en Formato Unix
    address usuario; // DirecciÃ³n de la Red

    constructor() {
        mensaje = "Hola mundo!";
        usuario = msg.sender;
        fecha = block.timestamp;
    }

    function guardarMensaje(string memory nuevoMensaje) public {
        mensaje = nuevoMensaje;
        usuario = msg.sender;
        fecha = block.timestamp;
    }

    function verMensaje() public view returns(string memory, uint, address) {
        return (mensaje, fecha, usuario);
    }

}

